busTicketsString.mapToPair(new org.apache.spark.api.java.function.PairFunction<java.lang.String, java.lang.String, recordLinkage.dependencies.TicketInformation>() {
    public scala.Tuple2<java.lang.String, recordLinkage.dependencies.TicketInformation> call(java.lang.String entry) throws java.lang.Exception {
        entry += " ";
        java.lang.String[] splittedEntry = entry.split((("(?<=" + (recordLinkage.BUSTEstimationV3.SEPARATOR)) + ")"));
        recordLinkage.dependencies.TicketInformation ticket = new recordLinkage.dependencies.TicketInformation(splittedEntry[0].replace(recordLinkage.BUSTEstimationV3.SEPARATOR, ""), splittedEntry[1].replace(recordLinkage.BUSTEstimationV3.SEPARATOR, ""), splittedEntry[2].replace(recordLinkage.BUSTEstimationV3.SEPARATOR, ""), splittedEntry[3].replace(recordLinkage.BUSTEstimationV3.SEPARATOR, ""), splittedEntry[4].replace(recordLinkage.BUSTEstimationV3.SEPARATOR, ""), splittedEntry[5].replace(recordLinkage.BUSTEstimationV3.SEPARATOR, ""), splittedEntry[6].replace(recordLinkage.BUSTEstimationV3.SEPARATOR, ""), splittedEntry[7].replace(recordLinkage.BUSTEstimationV3.SEPARATOR, ""));
        return new scala.Tuple2<java.lang.String, recordLinkage.dependencies.TicketInformation>(ticket.getBusCode(), ticket);
    }
}).groupByKey()
